Robert Palmer - Discipline of Love [promo].mp4



HQ rare promo music video. &quot;Discipline of Love&quot; is a song from Riptide, an album by the British singer Robert Palmer, released in November 1985. It featured his hit single &quot;Addicted to Love&quot; which reached #1 on the US Billboard Hot 100 chart in 1986, helped by a memorable music video. Palmer won a Grammy Award for the song in 1987.

The album also featured Palmer's Power Station bandmates Andy Taylor and Tony Thompson providing guitar and drum services respectively. Power Station producer Bernard Edwards (from Chic) played bass and produced the album as well.
